The aircraft flight level at the time of the occurrence. Flight level: A surface of constant atmospheric pressure which is related to a specific pressure datum, 1 013.2 hectopascals (hPa), and is separated from other such surfaces by specific pressure intervals.  
Note 1. - A pressure type altimeter calibrated in accordance with the standard atmosphere: 
a) when set to a QNH altimeter setting, will indicate altitude; 
b) when set to a QFE altimeter setting, will indicate height above the QFE reference datum; 
c) when set to a pressure 1 013.2 hPa, may be used to indicate flight levels.
Note 2. - The terms "height" and "altitude", used in Note 1 above, indicate altimetric rather than geometric heights and altitudes.

Information whether the pilot was advised of en-route weather phenomena which may affect the safety of aircraft operations (SIGMET)
SIGMET: Meteorological information issued concerning weather significant to the safety of aircraft. SIGMET advisories include the following: 
(a) active thunderstorm areas or lines of thunderstorms; 
(b) hurricanes, tropical storms; 
(c) moderate hail; 
(d) severe turbulence; 
(e) severe icing; 
(f) marked mountain waves; 
(g) widespread sandstorms and dust storms; 
(h) volcanic ash;
(i) severe squall lines;
(j) low-level wind shear; and
(k) tornadoes or waterspouts. 

